import React from 'react';
import ArticleCard from 'components/ArticleCard/ArticleCard';
import Wrapper, {
  Title,
  Border,
  ArticleOne,
  ArticleTwo,
  ArticleWrapper,
  ArticleWrapperTwo
} from './Article.style';

const Pricing = () => {

    return (
        <Wrapper>  
            <Title>Berita Terbaru</Title>
            <Border />
            <ArticleWrapper>
                <ArticleOne>
                    <ArticleCard title="Article 1"/>
                </ArticleOne>
                <ArticleWrapperTwo>
                    <ArticleTwo>
                        <ArticleCard title="Article 1"/>
                        <ArticleCard title="Article 1"/>
                    </ArticleTwo>
                    <ArticleTwo>
                        <ArticleCard title="Article 1"/>
                        <ArticleCard title="Article 1"/>
                    </ArticleTwo>
                </ArticleWrapperTwo>
            </ArticleWrapper>
        </Wrapper>
    );
};

export default Pricing;
